import React, { useEffect, useState } from 'react';
import 'bootstrap-icons/font/bootstrap-icons.css';
import { Link, useLocation } from 'react-router-dom';

const Sidebar = () => {
  const [categories, setCategories] = useState([]);
  const [counts, setCounts] = useState({
    completed: 0,
    pending: 0,
    high: 0,
    medium: 0,
    low: 0,
    personal: 0,
    household: 0,
    financial: 0,
    work: 0,
    errand: 0,
    help: 0,
    total: 0
  });

  const location = useLocation();
  const queryParams = new URLSearchParams(location.search);
  const username = queryParams.get('username');

  useEffect(() => {
    fetchCategories();
    fetchTodos();
  }, []);

  const fetchCategories = async () => {
    try {
      const response = await fetch('http://localhost:8083/api/categories');
      const data = await response.json();
      setCategories(data);
    } catch (error) {
      console.error('Error fetching categories:', error);
    }
  };

  const fetchTodos = async () => {
    try {
      const response = await fetch('http://localhost:8083/api/todos');
      const data = await response.json();
      calculateCounts(data);
    } catch (error) {
      console.error('Error fetching todos:', error);
    }
  };

  const calculateCounts = (todos) => {
    const counts = {
      completed: 0,
      pending: 0,
      high: 0,
      medium: 0,
      low: 0,
      personal: 0,
      household: 0,
      financial: 0,
      work: 0,
      errand: 0,
      help: 0,
      total: 0
    };

    todos.forEach(todo => {
      if (todo.completed) {
        counts.completed++;
      } else {
        counts.pending++;
      }

      switch (todo.priority.toLowerCase()) {
        case 'high':
          counts.high++;
          break;
        case 'medium':
          counts.medium++;
          break;
        case 'low':
          counts.low++;
          break;
        default:
          break;
      }

      switch (todo.category.toLowerCase()) {
        case 'personal task':
          counts.personal++;
          break;
        case 'household task':
          counts.household++;
          break;
        case 'financial task':
          counts.financial++;
          break;
        case 'work task':
          counts.work++;
          break;
        case 'errand':
          counts.errand++;
          break;
        case 'help others':
          counts.help++;
          break;
        default:
          break;
      }

      counts.total++;
    });

    setCounts(counts);
  };

  const getCategoryCount = (categoryName) => {
    switch (categoryName.toLowerCase()) {
      case 'personal task':
        return counts.personal;
      case 'household task':
        return counts.household;
      case 'financial task':
        return counts.financial;
      case 'work task':
        return counts.work;
      case 'errand':
        return counts.errand;
      case 'help others':
        return counts.help;
      default:
        return 0;
    }
  };

  return (
    <div className="bg-dark text-white p-3">
      <h4> Welcome {username}!</h4>
      <h5>Categories</h5>
      <ul className="list-unstyled">
        {categories.map((category, index) => (
          <li key={index}>
            <Link to={`/category/${category.name}`} className="text-decoration-none text-white">
              {category.name} ({getCategoryCount(category.name)})
            </Link>
          </li>
        ))}
      </ul>
      <div className="mt-3">
        <h5>Status</h5>
        <p>Completed: {counts.completed}</p>
        <p>Pending: {counts.pending}</p>
      </div>
      <div className="mt-3">
        <h5>Priority</h5>
        <p>High: {counts.high}</p>
        <p>Medium: {counts.medium}</p>
        <p>Low: {counts.low}</p>
      </div>
      <div className="mt-3">
        <h5>Tasks Summary</h5>
        <p>Total: {counts.total}</p>
      </div>
    </div>
  );
};n

export default Sidebar;
